# Parse the HTML content
soup = BeautifulSoup(html_content, 'html.parser')

# Find all rows in the table
rows = soup.find_all('tr')

# List to store dataset names and links
data = []

for row in rows:
    link_cell = row.find('td', headers='LINK')
    name_cell = row.find('td', headers='DATASET_NAME')
    
    if link_cell and name_cell:
        link_tag = link_cell.find('a')
        if link_tag and 'href' in link_tag.attrs:
            link = link_tag['href']
            name = name_cell.get_text(strip=True)
            data.append([name, link])

# Write data to a CSV file
output_file = 'datasets.csv'
with open(output_file, mode='w', newline='', encoding='utf-8') as file:
    writer = csv.writer(file)
    writer.writerow(['Dataset Name', 'Link'])
    writer.writerows(data)

print(f"Extracted {len(data)} datasets and saved to '{output_file}'")
